from lxml import html
import requests
import datetime


def populate_detailed_data(key):
    url = 'http://www.harriscountyfws.org/GageDetail/Index/' + str(key)
    page = requests.get(url)
    tree = html.fromstring(page.content)

    sensor_type = tree.xpath("//*[text()='Sensor Type']")[0].getnext().text

    date_installed = tree.xpath("//*[text()='Installed']")[0].getnext().text
    date_installed = datetime.datetime.strptime(date_installed,"%m/%d/%Y").strftime("%Y-%m-%d")
    tob = tree.xpath("//*[text()='Top of Bank (TOB)']")[0].getnext().text[:-1]
    boc = tree.xpath("//*[text()='Bottom of Channel (BOC)']")[0].getnext().text[:-1]
    tip_of_orfice = tree.xpath("//*[text()='Tip of Orifice']")[0].getnext().text[:-1]
    measuring_plate = tree.xpath("//*[text()='Measuring Plate']")[0].getnext().text[:-1]
    benchmark = tree.xpath("//*[text()='Benchmark']")[0].getnext().text[:-1]

    sql = "UPDATE sensor_info SET sensor_type='" + sensor_type + "', date_installed='" + date_installed + \
          "', top_of_bank=" + tob + ", bottom_of_channel=" + boc + ", tip_of_orfice=" + tip_of_orfice + \
          ", measuring_plate=" + measuring_plate + ", benchmark=" + benchmark + \
          " WHERE sensor_id="+str(key)

    cursor = cnx.cursor()
    cursor.execute(sql)
    cursor.close()

